    // document.getElementById("contentOne").scrollIntoView();
    src_services_logger_service__WEBPACK_IMPORTED_MODULE_11__.Logger.log(JSON.stringify(this.booking));
    src_services_logger_service__WEBPACK_IMPORTED_MODULE_11__.Logger.log(JSON.stringify(this.checkAvailabilityStatusHide));
