  getDateFormatYearMonthDay(day12, month12, year12) {
    const year = year12;
    const date = day12;
    const month = month12;
    let month1;
    let day1;
    if (Number(month) < 10) {
      month1 = `0${month}`;
    } else {
      month1 = `${month}`;
    }
    if (Number(date) < 10) {
      day1 = `0${date}`;
    } else {
      day1 = `${date}`;
    }
    return `${year}-${month1}-${day1}`;
  }
  getDateFormatDayMonthYear(day12, month12, year12) {
    const year = year12;
    const date = day12;
    const month = month12;
    let month1;
    let day1;
    if (Number(month) < 10) {
      month1 = `0${month}`;
    } else {
      month1 = `${month}`;
    }
    if (Number(date) < 10) {
      day1 = `0${date}`;
    } else {
      day1 = `${date}`;
    }
    return `${day1}-${month1}-${year}`;
  }
